(window.webpackJsonp=window.webpackJsonp||[]).push([[110],{EdNp:function(e){e.exports=[{id:1,type:"  ucloud_instance",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"availability_zone",description:'<strong>(Required)</strong> Availability zone where instance is located. such as: <code>cn-bj2-02</code>. You may refer to <a href="https://docs.ucloud.cn/api/summary/regionlist">list of availability zone</a>\n',elementType:"li",listDepth:1},{name:"image_id",description:"<strong>(Required)</strong> The ID for the image to use for the instance.\n",elementType:"li",listDepth:1},{name:"instance_type",description:'<li><p><a name="instance_type"></a><a href="#instance_type"><code>instance_type</code></a> - <strong>(Required)</strong> The type of instance, please visit the <a href="https://www.terraform.io/docs/providers/ucloud/appendix/instance_type.html">instance type table</a></p>\n<div class="alert alert-warning" role="alert">\n<p><strong>Note</strong> If you want to update this value, you must set <code>allow_stopping_for_update</code>to <code>true</code>.</p>\n</div>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"allow_stopping_for_update",description:'<li><p><a name="allow_stopping_for_update"></a><a href="#allow_stopping_for_update"><code>allow_stopping_for_update</code></a> - <strong>(Optional)</strong> If you try to update some properties which requires stopping the instance, you must set <code>allow_stopping_for_update</code> to <code>true</code> in your config to allows Terraform to stop the instance to update its properties like <code>instance_type</code>, <code>root_password</code>, <code>boot_disk_size</code>, <code>data_disk_size</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"root_password",description:'<li><p><a name="root_password"></a><a href="#root_password"><code>root_password</code></a> - <strong>(Optional)</strong> The password for the instance, which contains 8-30 characters, and at least 2 items of capital letters, lower case letters, numbers and special characters. The special characters include <code>`()~!@#$%<sup>&amp;*-+=_|{}[]:;\'&lt;&gt;,.?/</sup></code>.</p></li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/instance.html",docType:""},{id:2,type:"  ucloud_disk",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"availability_zone",description:'<strong>(Required)</strong>  Availability zone where cloud disk is located. Such as: "cn-bj2-02". You may refer to <a href="https://docs.ucloud.cn/api/summary/regionlist">list of availability zone</a>.\n',elementType:"li",listDepth:1},{name:"disk_size",description:"<strong>(Required)</strong> The size of disk. Purchase the size of disk in GB. 1-8000 for a cloud disk, 1-4000 for SSD cloud disk. If the disk have attached to the instance, the instance will reboot automatically to make the change take effect when update the  <code>disk_size</code>.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong>  The name of disk, should have 6-63 characters and only support Chinese, English, numbers, '-', '_'. If not specified, terraform will auto-generate a name beginning with <code>tf-disk</code>.\n",elementType:"li",listDepth:1},{name:"disk_type",description:"<strong>(Optional)</strong> The type of disk. Possible values are: <code>data_disk</code>as cloud disk, <code>ssd_data_disk</code> as ssd cloud disk, <code>rssd_data_disk</code> as RDMA-SSD cloud disk (the <code>rssd_data_disk</code> only be supported in <code>cn-bj2-05</code>).(Default: <code>data_disk</code>).\n",elementType:"li",listDepth:1},{name:"charge_type",description:"<strong>(Optional)</strong> Charge type of disk. Possible values are: <code>year</code> as pay by year, <code>month</code> as pay by month, <code>dynamic</code> as pay by hour. (Default: <code>month</code>).\n",elementType:"li",listDepth:1},{name:"duration",description:"<strong>(Optional)</strong> The duration that you will buy the resource. (Default: <code>1</code>). It is not required when <code>dynamic</code> (pay by hour), the value is <code>0</code> when <code>month</code>(pay by month) and the disk will be vaild till the last day of that month.\n",elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to VPC, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/disk.html",docType:""},{id:3,type:"  ucloud_disk_attachment",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"availability_zone",description:"<strong>(Required)</strong> The Zone to attach the disk in.\n",elementType:"li",listDepth:1},{name:"instance_id",description:"<strong>(Required)</strong> The ID of host instance.\n",elementType:"li",listDepth:1},{name:"disk_id",description:"<strong>(Required)</strong> The ID of disk that needs to be attached\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/disk_attachment.html",docType:""},{id:4,type:"  ucloud_isolation_group",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Optional)</strong> The name of the isolation group information which contains 1-63 characters and only support Chinese, English, numbers, '-', '_', '.', ',', '[', ']', ':'. If not specified, terraform will auto-generate a name beginning with <code>tf-isolation-group</code>.\n",elementType:"li",listDepth:1},{name:"remark",description:'<strong>(Optional)</strong> The remarks of the isolation group. (Default: <code>""</code>).\n',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/isolation_group.html",docType:""},{id:5,type:"  ucloud_security_group",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"rules",description:"<strong>(Required)</strong> A list of security group rules. Can be specified multiple times for each rules. Each rules supports fields documented below.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong> The name of the security group which contains 1-63 characters and only support Chinese, English, numbers, '-', '_' and '.'. If not specified, terraform will auto-generate a name beginning with <code>tf-security-group</code>.\n",elementType:"li",listDepth:1},{name:"remark",description:'<strong>(Optional)</strong> The remarks of the security group. (Default: <code>""</code>).\n',elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to security group, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1},{name:"block-rules",description:'<h3 id="block-rules">\n<a class="anchor" href="#block-rules" name="block-rules">\xbb</a>\n  Block rules\n</h3>',elementType:"h3"},{name:"",description:"<p>The rules mapping supports the following:</p>",elementType:"p"},{name:"port_range",description:"<strong>(Optional)</strong> The range of port numbers, range: 1-65535. (eg: <code>port</code> or <code>port1-port2</code>).\n",elementType:"li",listDepth:1},{name:"cidr_block",description:"<strong>(Optional)</strong> The cidr block of source.\n",elementType:"li",listDepth:1},{name:"policy",description:"<strong>(Optional)</strong> Authorization policy. Possible values are: <code>accept</code>, <code>drop</code>.\n",elementType:"li",listDepth:1},{name:"priority",description:"<strong>(Optional)</strong> Rule priority. Possible values are: <code>high</code>, <code>medium</code>, <code>low</code>.\n",elementType:"li",listDepth:1},{name:"protocol",description:"<strong>(Optional)</strong> The protocol. Possible values are: <code>tcp</code>, <code>udp</code>, <code>icmp</code>, <code>gre</code>.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/security_group.html",docType:""},{id:6,type:"  ucloud_eip",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"internet_type",description:"<strong>(Required)</strong> Type of Elastic IP routes. Possible values are: <code>international</code> as international BGP IP and <code>bgp</code> as china mainland BGP IP.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"bandwidth",description:"<strong>(Optional)</strong> Maximum bandwidth to the elastic public network, measured in Mbps (Mega bit per second). The ranges for bandwidth are: 1-200 for pay by traffic, 1-800 for pay by bandwidth. (Default: <code>1</code>).\n",elementType:"li",listDepth:1},{name:"share_bandwidth_package_id",description:"<strong>(Optional)</strong> The\uffff Id of Share Bandwidth Package. If it is filled in, the <code>charge_mode</code> can only be set with <code>share_bandwidth</code>.\n",elementType:"li",listDepth:1},{name:"duration",description:"<strong>(Optional)</strong> The duration that you will buy the resource. (Default: <code>1</code>). It is not required when <code>dynamic</code> (pay by hour), the value is <code>0</code> when <code>month</code>(pay by month) and the instance will be valid till the last day of that month.\n",elementType:"li",listDepth:1},{name:"charge_mode",description:" -<strong>(Optional)</strong> Elastic IP charge mode. Possible values are: <code>traffic</code> as pay by traffic, <code>bandwidth</code> as pay by bandwidth, <code>share_bandwidth</code> as share bandwidth mode. (Default: <code>bandwidth</code>for the Elastic IP, <code>share_bandwidth</code> for the Elastic IP with share bandwidth mode).\n",elementType:"li",listDepth:1},{name:"charge_type",description:"<strong>(Optional)</strong> Elastic IP charge type. Possible values are: <code>year</code> as pay by year, <code>month</code> as pay by month, <code>dynamic</code> as pay by hour (specific permission required). (Default: <code>month</code>).\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Optional)</strong> The name of the EIP, which contains 1-63 characters and only support Chinese, English, numbers, '-', '_', '.'. If not specified, terraform will auto-generate a name beginning with <code>tf-eip</code>.\n",elementType:"li",listDepth:1},{name:"remark",description:'<strong>(Optional)</strong> The remarks of the EIP. (Default: <code>""</code>).\n',elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to Elastic IP, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/eip.html",docType:""},{id:7,type:"  ucloud_eip_association",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"eip_id",description:"<strong>(Required)</strong> The ID of EIP.\n",elementType:"li",listDepth:1},{name:"resource_id",description:"<strong>(Required)</strong> The ID of resource with EIP attached.\n",elementType:"li",listDepth:1},{name:"resource_type",description:"<strong>Deprecated</strong>, attribute <code>resource_type</code> is deprecated for optimizing parameters.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/eip_association.html",docType:""},{id:8,type:"  ucloud_lb",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"internal",description:'<strong>(Optional)</strong> Indicate whether the load balancer is intranet mode.(Default: <code>"false"</code>)\n',elementType:"li",listDepth:1},{name:"name",description:"<strong>(Optional)</strong> The name of the load balancer. If not specified, terraform will auto-generate a name beginning with <code>tf-lb</code>.\n",elementType:"li",listDepth:1},{name:"charge_type",description:"<strong>Deprecated</strong>, argument <code>charge_type</code> is deprecated for optimizing parameters.\n",elementType:"li",listDepth:1},{name:"vpc_id",description:"<strong>(Optional)</strong> The ID of the VPC linked to the Load balancer, This argument is not required if default VPC.\n",elementType:"li",listDepth:1},{name:"subnet_id",description:"<strong>(Optional)</strong> The ID of subnet that intranet load balancer belongs to. This argument is not required if default subnet.\n",elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to load balancer, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1},{name:"remark",description:'<strong>(Optional)</strong> The remarks of the load balancer. (Default: <code>""</code>).\n',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/lb.html",docType:""},{id:9,type:"  ucloud_lb_attachment",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"load_balancer_id",description:"<strong>(Required)</strong> The ID of a load balancer.\n",elementType:"li",listDepth:1},{name:"listener_id",description:"<strong>(Required)</strong> The ID of a listener server.\n",elementType:"li",listDepth:1},{name:"resource_id",description:"<strong>(Required)</strong> The ID of a backend server.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"resource_type",description:"<strong>Deprecated</strong>, attribute <code>resource_type</code> is deprecated for optimizing parameters.\n",elementType:"li",listDepth:1},{name:"port",description:"<strong>(Optional)</strong> Port opened on the backend server to receive requests, range: 1-65535, (Default: <code>80</code>).\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/lb_attachment.html",docType:""},{id:10,type:"  ucloud_lb_listener",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"load_balancer_id",description:"<strong>(Required)</strong> The ID of load balancer instance.\n",elementType:"li",listDepth:1},{name:"protocol",description:"<strong>(Required)</strong> Listener protocol. Possible values: <code>http</code>, <code>https</code>, <code>tcp</code> if <code>listen_type</code> is <code>request_proxy</code>, <code>tcp</code> and <code>udp</code> if <code>listen_type</code> is <code>packets_transmit</code>.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong> The name of the listener. If not specified, terraform will auto-generate a name beginning with <code>tf-lb-listener</code>.\n",elementType:"li",listDepth:1},{name:"listen_type",description:'<strong>(Optional)</strong> The type of listener. Possible values are <code>request_proxy</code> and <code>packets_transmit</code>. When <code>packets_transmit</code> was specified, you need to config the instances by yourself if the instances attach to the load balancer. You may refer to <a href="https://docs.ucloud.cn/network/ulb/guide/fu-wu-jie-dian-xiang-guan-cao-zuo/editrealserver">configuration instruction</a>.\n',elementType:"li",listDepth:1},{name:"port",description:"<strong>(Optional)</strong> Port opened on the listeners to receive requests, range: 1-65535. The default value: <code>80</code> as <code>protocol</code> is <code>http</code>, <code>443</code> as <code>protocol</code> is <code>https</code>, <code>1024</code> as <code>protocol</code> is <code>tcp</code> or <code>udp</code>.\n",elementType:"li",listDepth:1},{name:"idle_timeout",description:"<strong>(Optional)</strong> Amount of time in seconds to wait for the response for in between two sessions if <code>listen_type</code> is <code>request_proxy</code>, range: 0-86400. (Default: <code>60</code>). Amount of time in seconds to wait for one session if <code>listen_type</code> is <code>packets_transmit</code>, range: 60-900. The session will be closed as soon as no response if it is <code>0</code>.\n",elementType:"li",listDepth:1},{name:"list description",description:'<a name="method"></a>',elementType:"p"},{name:"consistent_hash",description:"<li>The <code>consistent_hash</code>, <code>source_port</code> , <code>consistent_hash_port</code>, <code>roundrobin</code>, <code>source</code> and <code>weight_roundrobin</code> are valid if <code>listen_type</code> is <code>packets_transmit</code>.\n</li>",elementType:"li",listDepth:2},{name:"roundrobin",description:"<li>The <code>roundrobin</code>, <code>source</code> and <code>weight_roundrobin</code> and <code>leastconn</code> are valid if <code>listen_type</code> is <code>request_proxy</code>.\n</li>",elementType:"li",listDepth:2},{name:"persistence",description:"<strong>(Optional)</strong> Indicate whether the persistence session is enabled, it is invalid if <code>persistence_type</code> is <code>none</code>, an auto-generated string will be exported if <code>persistence_type</code> is <code>server_insert</code>, a custom string will be exported if <code>persistence_type</code> is <code>user_defined</code>.\n",elementType:"li",listDepth:1},{name:"persistence_type",description:"<strong>(Optional)</strong> The type of session persistence of listener. Possible values are: <code>none</code> as disabled, <code>server_insert</code> as auto-generated key and <code>user_defined</code> as customized key. (Default: <code>none</code>).\n",elementType:"li",listDepth:1},{name:"health_check_type",description:"<strong>(Optional)</strong> Health check method. Possible values are <code>port</code> as port checking and <code>path</code> as http checking.\n",elementType:"li",listDepth:1},{name:"path",description:"<strong>(Optional)</strong> Health check path checking.\n",elementType:"li",listDepth:1},{name:"domain",description:"<strong>(Optional)</strong> Health check domain checking.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/lb_listener.html",docType:""},{id:11,type:"  ucloud_lb_rule",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"load_balancer_id",description:"<strong>(Required)</strong> The ID of a load balancer.\n",elementType:"li",listDepth:1},{name:"listener_id",description:"<strong>(Required)</strong> The ID of a listener server.\n",elementType:"li",listDepth:1},{name:"backend_ids",description:"<strong>(Required)</strong> The IDs of the backend servers where rule applies, this argument is populated base on the <code>backend_id</code> responded from <code>lb_attachment</code> create.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"path",description:"<strong>(Optional)</strong> The path of Content forward matching fields. <code>path</code> and <code>domain</code> cannot coexist. <code>path</code> and <code>domain</code> must be filled in one.\n",elementType:"li",listDepth:1},{name:"domain",description:"<strong>(Optional)</strong> The domain of content forward matching fields. <code>path</code> and <code>domain</code> cannot coexist. <code>path</code> and <code>domain</code> must be filled in one.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/lb_rule.html",docType:""},{id:12,type:"  ucloud_lb_ssl",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"private_key",description:"<strong>(Required)</strong>  The content of the private key about ssl certificate.\n",elementType:"li",listDepth:1},{name:"user_cert",description:"<strong>(Required)</strong>  The content of the user certificate about ssl certificate.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong> The name of the LB ssl, which contains 1-63 characters and only support Chinese, English, numbers, '-', '_', '.'. If not specified, terraform will auto-generate a name beginning with <code>tf-lb-ssl</code>.\n",elementType:"li",listDepth:1},{name:"ca_cert",description:"<strong>(Optional)</strong> The content of the CA certificate about ssl certificate.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/lb_ssl.html",docType:""},{id:13,type:"  ucloud_lb_ssl",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"ssl_id",description:"<strong>(Required)</strong> The ID of SSL certificate.\n",elementType:"li",listDepth:1},{name:"load_balance_id",description:"<strong>(Required)</strong> The ID of load balancer instance.\n",elementType:"li",listDepth:1},{name:"listener_id",description:"<strong>(Required)</strong>  The ID of listener servers.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/lb_ssl_attachment.html",docType:""},{id:14,type:"  ucloud_vpc",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"cidr_blocks",description:"<strong>(Required)</strong> The CIDR blocks of VPC.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong> The name of VPC. If not specified, terraform will auto-generate a name beginning with <code>tf-vpc</code>.\n",elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to VPC, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1},{name:"remark",description:'<strong>(Optional)</strong> The remarks of the VPC. (Default: <code>""</code>).\n',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/vpc.html",docType:""},{id:15,type:"  ucloud_vpc_peering_connection",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"vpc_id",description:"<strong>(Required)</strong> The short of ID of the requester VPC of the specific VPC Peering Connection to retrieve.\n",elementType:"li",listDepth:1},{name:"peer_vpc_id",description:"<strong>(Required)</strong> The short ID of accepter VPC of the specific VPC Peering Connection to retrieve.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"peer_project_id",description:"<strong>(Optional)</strong> The ID of accepter project of the specific VPC Peering Connection to retrieve.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/vpc_peering_connection.html",docType:""},{id:16,type:"  ucloud_subnet",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"cidr_block",description:'<strong>(Required)</strong> The cidr block of the desired subnet, format in "0.0.0.0/0", such as: <code>192.168.0.0/24</code>.\n',elementType:"li",listDepth:1},{name:"vpc_id",description:"<strong>(Required)</strong> The id of the VPC that the desired subnet belongs to.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong> The name of the desired subnet. If not specified, terraform will auto-generate a name beginning with <code>tf-subnet</code>.\n",elementType:"li",listDepth:1},{name:"remark",description:'<strong>(Optional)</strong> The remarks of the subnet. (Default: <code>""</code>).\n',elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to subnet, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/subnet.html",docType:""},{id:17,type:"  ucloud_nat_gateway",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"vpc_id",description:"<strong>(Required)</strong> The ID of VPC linked to the Nat Gateway. \n",elementType:"li",listDepth:1},{name:"subnet_ids",description:"<strong>(Required)</strong> The list of subnet ID under the VPC.\n",elementType:"li",listDepth:1},{name:"eip_id",description:"<strong>(Required)</strong> The ID of eip associate to the Nat Gateway. \n",elementType:"li",listDepth:1},{name:"security_group",description:"<strong>(Required)</strong> The ID of the associated security group.\n",elementType:"li",listDepth:1},{name:"enable_white_list",description:"<strong>(Required)</strong> The boolean value to Controls whether or not start the whitelist mode.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"white_list",description:"<strong>(Optional)</strong> The white list of instance under the Nat Gateway.\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Optional)</strong> The name of the Nat Gateway which contains 6-63 characters and only support Chinese, English, numbers, '-', '_' and '.'. If not specified, terraform will auto-generate a name beginning with <code>tf-nat-gateway-</code>.\n",elementType:"li",listDepth:1},{name:"remark",description:'<strong>(Optional)</strong> The remarks of the Nat Gateway. (Default: <code>""</code>).\n',elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to Nat Gateway, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1},{name:"``\n## Attributes Reference\n",description:"<li>``\n## Attributes Reference\n</li>",elementType:"li",listDepth:1},{name:"",description:"<p>In addition to all arguments above, the following attributes are exported:</p>",elementType:"p"},{name:"create_time",description:"The time of creation of Nat Gateway, formatted in RFC3339 time string.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/nat_gateway.html",docType:""},{id:18,type:"  ucloud_nat_gateway_rule",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"nat_gateway_id",description:"<strong>(Required)</strong> The ID of the Nat Gateway. \n",elementType:"li",listDepth:1},{name:"protocol",description:"<strong>(Required)</strong> The protocol of the Nat Gateway Rule. Possible values: <code>tcp</code>, <code>udp</code>.\n",elementType:"li",listDepth:1},{name:"src_eip_id",description:"<strong>(Required)</strong> The ID of eip associate to the Nat Gateway.\n",elementType:"li",listDepth:1},{name:"src_port_range",description:"<strong>(Required)</strong> The range of port numbers of the eip, range: 1-65535. (eg: <code>port</code> or <code>port1-port2</code>).\n",elementType:"li",listDepth:1},{name:"dst_ip",description:"<strong>(Required)</strong> The private ip of instance bound to the jNAT gateway.\n",elementType:"li",listDepth:1},{name:"dst_port_range",description:"<strong>(Required)</strong> The range of port numbers of the private ip, range: 1-65535. (eg: <code>port</code> or <code>port1-port2</code>).\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong> The name of the Nat Gateway Rule which contains 6-63 characters and only support Chinese, English, numbers, '-', '_' and '.'. If not specified, terraform will auto-generate a name beginning with <code>tf-nat-gateway-rule-</code>.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/nat_gateway_rule.html",docType:""},{id:19,type:"  ucloud_vip",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"vpc_id",description:"<strong>(Required)</strong> The ID of VPC linked to the VIP. \n",elementType:"li",listDepth:1},{name:"subnet_id",description:"<strong>(Required)</strong> The ID of subnet. If defined <code>vpc_id</code>, the <code>subnet_id</code> is Required. \n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong> The name of VIP. If not specified, terraform will auto-generate a name beginning with <code>tf-vip-</code>.\n",elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to VIP, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1},{name:"remark",description:'<strong>(Optional)</strong> The remarks of the VIP. (Default: <code>""</code>).\n',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/vip.html",docType:""},{id:20,type:"  ucloud_db_instance",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"availability_zone",description:'<strong>(Required)</strong> Availability zone where database instance is located. Such as: "cn-bj2-02". You may refer to <a href="https://docs.ucloud.cn/api/summary/regionlist">list of availability zone</a>\n',elementType:"li",listDepth:1},{name:"engine",description:'<strong>(Required)</strong> The type of database engine, possible values are: "mysql", "percona".\n',elementType:"li",listDepth:1},{name:"list description",description:'<a name="engine_version"></a>',elementType:"p"},{name:"5.5/5.6/5.7 for mysql and percona engine. \n",description:"<li>5.5/5.6/5.7 for mysql and percona engine. \n</li>",elementType:"li",listDepth:2},{name:"name",description:"<strong>(Optional)</strong> The name of database instance, which contains 6-63 characters and only support Chinese, English, numbers, '-', '_', '.', ',', '[', ']', ':'. If not specified, terraform will auto-generate a name beginning with <code>tf-db-instance</code>.\n",elementType:"li",listDepth:1},{name:"list description",description:'<a name="instance_storage"></a>',elementType:"p"},{name:"500GB if the memory chosen is equal or less than 6GB;\n",description:"<li>500GB if the memory chosen is equal or less than 6GB;\n</li>",elementType:"li",listDepth:2},{name:"1000GB if the memory chosen is from 8 to 16GB;\n",description:"<li>1000GB if the memory chosen is from 8 to 16GB;\n</li>",elementType:"li",listDepth:2},{name:"2000GB if the memory chosen is 24GB or 32GB;\n",description:"<li>2000GB if the memory chosen is 24GB or 32GB;\n</li>",elementType:"li",listDepth:2},{name:"3500GB if the memory chosen is 48GB or 64GB;\n",description:"<li>3500GB if the memory chosen is 48GB or 64GB;\n</li>",elementType:"li",listDepth:2},{name:"4500GB if the memory chosen is equal or more than 96GB;\n",description:"<li>4500GB if the memory chosen is equal or more than 96GB;\n</li>",elementType:"li",listDepth:2},{name:"instance_type",description:'<strong>(Required)</strong> The type of database instance, please visit the <a href="https://www.terraform.io/docs/providers/ucloud/appendix/db_instance_type.html">instance type table</a>.\n',elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"standby_zone",description:"<strong>(Optional)</strong> Availability zone where the standby database instance is located for the high availability database instance with multiple zone; The disaster recovery of data center can be activated by switching to the standby database instance for the high availability database instance.\n",elementType:"li",listDepth:1},{name:"password",description:"<strong>(Optional)</strong> The password for the database instance which should have 8-30 characters. It must contain at least 3 items of Capital letters, small letter, numbers and special characters. The special characters include <code>-_</code>. If not specified, terraform will auto-generate a password.\n",elementType:"li",listDepth:1},{name:"port",description:"<strong>(Optional)</strong> The port on which the database accepts connections, the default port is 3306 for mysql and percona.\n",elementType:"li",listDepth:1},{name:"charge_type",description:"<strong>(Optional)</strong> The charge type of db instance, possible values are: <code>year</code>, <code>month</code> and <code>dynamic</code> as pay by hour (specific permission required). (Default: <code>month</code>).\n",elementType:"li",listDepth:1},{name:"duration",description:"<strong>(Optional)</strong> The duration that you will buy the db instance (Default: <code>1</code>). The value is <code>0</code> when pay by month and the instance will be vaild till the last day of that month. It is not required when <code>dynamic</code> (pay by hour).\n",elementType:"li",listDepth:1},{name:"vpc_id",description:"<strong>(Optional)</strong> The ID of VPC linked to the database instances.\n",elementType:"li",listDepth:1},{name:"subnet_id",description:"<strong>(Optional)</strong> The ID of subnet.\n",elementType:"li",listDepth:1},{name:"backup_count",description:"<strong>(Optional)</strong> Specifies the number of backup saved per week, it is 7 backups saved per week by default.\n",elementType:"li",listDepth:1},{name:"backup_begin_time",description:"<strong>(Optional)</strong> Specifies when the backup starts, measured in hour, it starts at one o'clock of 1, 2, 3, 4 in the morning by default.\n",elementType:"li",listDepth:1},{name:"backup_date",description:'<strong>(Optional)</strong> Specifies whether the backup took place from Sunday to Saturday by displaying 7 digits. 0 stands for backup disabled and 1 stands for backup enabled. The rightmost digit specifies whether the backup took place on Sunday, and the digits from right to left specify whether the backup took place from Monday to Saturday, it\'s mandatory required to backup twice per week at least. such as: digits "1100000" stands for the backup took place on Saturday and Friday.\n',elementType:"li",listDepth:1},{name:"backup_black_list",description:'<strong>(Optional)</strong> The backup for database such as "test.%" or table such as "city.address" specified in the black lists are not supported.\n',elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to database instance, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/db_instance.html",docType:""},{id:21,type:"  ucloud_redis_instance",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"availability_zone",description:'<strong>(Required)</strong> Availability zone where Redis instance is located. Such as: "cn-bj2-02". You may refer to <a href="https://docs.ucloud.cn/api/summary/regionlist">list of availability zone</a>\n',elementType:"li",listDepth:1},{name:"instance_type",description:'<strong>(Required)</strong> The type of Redis instance, please visit the <a href="https://www.terraform.io/docs/providers/ucloud/appendix/redis_instance_type.html">instance type table</a> for more details.\n',elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong> The name of Redis instance, which contains 6-63 characters and only support English, numbers, '-', '_'. If not specified, terraform will auto-generate a name beginning with <code>tf-redis-instance</code>.\n",elementType:"li",listDepth:1},{name:"charge_type",description:"<strong>(Optional)</strong> The charge type of Redis instance, possible values are: <code>year</code>, <code>month</code> and <code>dynamic</code> as pay by hour (specific permission required). (Default: <code>month</code>).\n",elementType:"li",listDepth:1},{name:"duration",description:"<strong>(Optional)</strong> The duration that you will buy the Redis instance (Default: <code>1</code>). The value is <code>0</code> when pay by month and the instance will be valid till the last day of that month. It is not required when <code>dynamic</code> (pay by hour).\n",elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to Redis instance, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1},{name:"vpc_id",description:"<strong>(Optional)</strong> The ID of VPC linked to the Redis instance.\n",elementType:"li",listDepth:1},{name:"subnet_id",description:"<strong>(Optional)</strong> The ID of subnet linked to the Redis instance.\n",elementType:"li",listDepth:1},{name:"engine_version",description:"(active-standby Redis Required) The version of engine of active-standby Redis. Possible values are: 3.0, 3.2 and 4.0.\n",elementType:"li",listDepth:1},{name:"password",description:"<strong>(Optional)</strong> The password for  active-standby Redis instance which should have 6-36 characters. It must contain at least 3 items of Capital letters, small letter, numbers and special characters. The special characters include <code>-_</code>. \n",elementType:"li",listDepth:1},{name:"",description:'<div class="alert alert-warning" role="alert">\n<p><strong>Note</strong> The active-standby Redis doesn\'t support to be created on multiple zones with Terraform.</p>\n</div>',elementType:"div"}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/redis_instance.html",docType:""},{id:22,type:"  ucloud_memcache_instance",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"availability_zone",description:'<strong>(Required)</strong> Availability zone where Memcache instance is located. Such as: "cn-bj2-02". You may refer to <a href="https://docs.ucloud.cn/api/summary/regionlist">list of availability zone</a>\n',elementType:"li",listDepth:1},{name:"instance_type",description:'<strong>(Required)</strong> The type of Memcache instance, please visit the <a href="https://www.terraform.io/docs/providers/ucloud/appendix/memcache_instance_type.html">instance type table</a> for more details.\n',elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong> The name of Memcache instance, which contains 6-63 characters and only support English, numbers, '-', '_'. If not specified, terraform will auto-generate a name beginning with <code>tf-memcache-instance</code>.\n",elementType:"li",listDepth:1},{name:"charge_type",description:"<strong>(Optional)</strong> The charge type of Memcache instance, possible values are: <code>year</code>, <code>month</code> and <code>dynamic</code> as pay by hour (specific permission required). (Default: <code>month</code>).\n",elementType:"li",listDepth:1},{name:"duration",description:"<strong>(Optional)</strong> The duration that you will buy the Memcache instance (Default: <code>1</code>). The value is <code>0</code> when pay by month and the instance will be valid till the last day of that month. It is not required when <code>dynamic</code> (pay by hour).\n",elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to Memcache instance, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1},{name:"vpc_id",description:"<strong>(Optional)</strong> The ID of VPC linked to the Memcache instance.\n",elementType:"li",listDepth:1},{name:"subnet_id",description:"<strong>(Optional)</strong> The ID of subnet linked to the Memcache instance.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/memcache_instance.html",docType:""},{id:23,type:"  ucloud_vpn_gateway",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"vpc_id",description:"<strong>(Required)</strong> The ID of VPC linked to the VPN Gateway. \n",elementType:"li",listDepth:1},{name:"grade",description:"<strong>(Required)</strong> The type of the VPN Gateway. Possible values: <code>standard</code>, <code>enhanced</code>. <code>standard</code> recommended application scenario: Applicable to services with bidirectional peak bandwidth of 1M~50M; <code>enhanced</code> recommended application scenario: Suitable for services with bidirectional peak bandwidths of 50M~100M.\n",elementType:"li",listDepth:1},{name:"eip_id",description:"<strong>(Required)</strong> The ID of eip associate to the VPN Gateway. \n",elementType:"li",listDepth:1},{name:"security_group",description:"<strong>(Required)</strong> The ID of the associated security group.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"charge_type",description:"<strong>(Optional)</strong> The charge type of VPN Gateway, possible values are: <code>year</code>, <code>month</code> and <code>dynamic</code> as pay by hour (specific permission required). (Default: <code>month</code>).\n",elementType:"li",listDepth:1},{name:"duration",description:"<strong>(Optional)</strong> The duration that you will buy the VPN Gateway (Default: <code>1</code>). The value is <code>0</code> when pay by month and the instance will be valid till the last day of that month. It is not required when <code>dynamic</code> (pay by hour).\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Optional)</strong> The name of the VPN Gateway which contains 1-63 characters and only support Chinese, English, numbers, '-', '_' and '.'. If not specified, terraform will auto-generate a name beginning with <code>tf-vpn-gateway-</code>.\n",elementType:"li",listDepth:1},{name:"remark",description:'<strong>(Optional)</strong> The remarks of the VPN Gateway. (Default: <code>""</code>).\n',elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to VPN Gateway, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1},{name:"``\n## Attributes Reference\n",description:"<li>``\n## Attributes Reference\n</li>",elementType:"li",listDepth:1},{name:"",description:"<p>In addition to all arguments above, the following attributes are exported:</p>",elementType:"p"},{name:"create_time",description:"The creation time for VPN Gateway, formatted in RFC3339 time string.\n",elementType:"li",listDepth:1},{name:"expire_time",description:"The expiration time for VPN Gateway, formatted in RFC3339 time string.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/vpn_gateway.html",docType:""},{id:24,type:"  ucloud_vpn_customer_gateway",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"ip_address",description:"<strong>(Required)</strong> The ip address of the VPN Customer Gateway. \n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong> The name of the VPN Customer Gateway which contains 1-63 characters and only support Chinese, English, numbers, '-', '_' and '.'. If not specified, terraform will auto-generate a name beginning with <code>tf-vpn-customer-gateway-</code>.\n",elementType:"li",listDepth:1},{name:"remark",description:'<strong>(Optional)</strong> The remarks of the VPN Customer Gateway. (Default: <code>""</code>).\n',elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to VPN Customer Gateway, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1},{name:"``\n## Attributes Reference\n",description:"<li>``\n## Attributes Reference\n</li>",elementType:"li",listDepth:1},{name:"",description:"<p>In addition to all arguments above, the following attributes are exported:</p>",elementType:"p"},{name:"create_time",description:"The creation time for VPN Customer Gateway, formatted in RFC3339 time string.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/vpn_customer_gateway.html",docType:""},{id:25,type:"  ucloud_vpn_connection",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"vpc_id",description:"<strong>(Required)</strong> The ID of VPC linked to the VPN Gateway Connection. \n",elementType:"li",listDepth:1},{name:"vpn_gateway_id",description:"<strong>(Required)</strong> The ID of  the VPN Customer Gateway. \n",elementType:"li",listDepth:1},{name:"customer_gateway_id",description:"<strong>(Required)</strong> The grade of the VPN Gateway\n",elementType:"li",listDepth:1},{name:"ike_config",description:"<strong>(Required)</strong> The configurations of IKE negotiation. Each ike_config supports fields documented below.\n",elementType:"li",listDepth:1},{name:"ipsec_config",description:"<strong>(Required)</strong> The configurations of IPSec negotiation. Each ipsec_config supports fields documented below.\n",elementType:"li",listDepth:1},{name:"",description:"<hr/>",elementType:"hr"},{name:"name",description:"<strong>(Optional)</strong> The name of the VPN Gateway Connection which contains 1-63 characters and only support Chinese, English, numbers and special characters: <code>-_.</code>. If not specified, terraform will auto-generate a name beginning with <code>tf-vpn-connection-</code>.\n",elementType:"li",listDepth:1},{name:"remark",description:'<strong>(Optional)</strong> The remarks of the VPN Gateway Connection. (Default: <code>""</code>).\n',elementType:"li",listDepth:1},{name:"tag",description:"<strong>(Optional)</strong> A tag assigned to VPN Gateway Connection, which contains at most 63 characters and only support Chinese, English, numbers, '-', '_', and '.'. If it is not filled in or a empty string is filled in, then default tag will be assigned. (Default: <code>Default</code>).\n",elementType:"li",listDepth:1},{name:"block-ike_config",description:'<h3 id="block-ike_config">\n<a class="anchor" href="#block-ike_config" name="block-ike_config">\xbb</a>\n  Block ike_config\n</h3>',elementType:"h3"},{name:"",description:"<p>The ike_config mapping supports the following:</p>",elementType:"p"},{name:"pre_shared_key",description:"<strong>(Required)</strong> The key used for authentication between the VPN gateway and the Customer gateway which contains 1-128 characters and only support English, numbers and special characters: <code>!@#$%^&amp;*()_+-=[]:,./'~</code>.\n",elementType:"li",listDepth:1},{name:"ike_version",description:"<strong>(Optional)</strong> The version of the IKE protocol which only be supported IKE V1 protocol at present. Possible values: ikev1. (Default: ikev1)\n",elementType:"li",listDepth:1},{name:"exchange_mode",description:"<strong>(Optional)</strong> The negotiation exchange mode of IKE V1 of VPN gateway. Possible values: <code>main</code> (main mode), <code>aggressive</code> (aggressive mode). (Default: <code>main</code>)\n",elementType:"li",listDepth:1},{name:"encryption_algorithm",description:"<strong>(Optional)</strong> The encryption algorithm of IKE negotiation. Possible values: <code>aes128</code>, <code>aes192</code>, <code>aes256</code>, <code>aes512</code>, <code>3des</code>. (Default: <code>aes128</code>).\n",elementType:"li",listDepth:1},{name:"authentication_algorithm",description:"<strong>(Optional)</strong> The authentication algorithm of IKE negotiation. Possible values: <code>sha1</code>, <code>md5</code>, <code>sha2-256</code>. (Default: <code>sha1</code>)\n",elementType:"li",listDepth:1},{name:"local_id",description:"<strong>(Optional)</strong> The identification of the VPN gateway.\n",elementType:"li",listDepth:1},{name:"remote_id",description:"<strong>(Optional)</strong> The identification of the Customer gateway.\n",elementType:"li",listDepth:1},{name:"dh_group",description:"<strong>(Optional)</strong> The Diffie-Hellman group used by IKE negotiation. Possible values: <code>1</code>, <code>2</code>, <code>5</code>, <code>14</code>, <code>15</code>, <code>16</code>. (Default:<code>15</code>)\n",elementType:"li",listDepth:1},{name:"sa_life_time",description:"<strong>(Optional)</strong> The Security Association lifecycle as the result of IKE negotiation. Unit: second. Range: 600-604800. (Default: <code>86400</code>)\n",elementType:"li",listDepth:1},{name:"block-ipsec_config",description:'<h3 id="block-ipsec_config">\n<a class="anchor" href="#block-ipsec_config" name="block-ipsec_config">\xbb</a>\n  Block ipsec_config\n</h3>',elementType:"h3"},{name:"",description:"<p>The ipsec_config mapping supports the following:</p>",elementType:"p"},{name:"local_subnet_ids",description:"<strong>(Required)</strong> The id list of Local subnet. \n",elementType:"li",listDepth:1},{name:"remote_subnets",description:"<strong>(Required)</strong> The ip address list of remote subnet.\n",elementType:"li",listDepth:1},{name:"protocol",description:"<strong>(Optional)</strong> The security protocol of IPSec negotiation. Possible values: <code>esp</code>, <code>ah</code>. (Default:<code>esp</code>)\n",elementType:"li",listDepth:1},{name:"encryption_algorithm",description:"<strong>(Optional)</strong> The encryption algorithm of IPSec negotiation. Possible values: <code>aes128</code>, <code>aes192</code>, <code>aes256</code>, <code>aes512</code>, <code>3des</code>. (Default: <code>aes128</code>).\n",elementType:"li",listDepth:1},{name:"authentication_algorithm",description:"<strong>(Optional)</strong> The authentication algorithm of IPSec negotiation. Possible values: <code>sha1</code>, <code>md5</code>. (Default: <code>sha1</code>)\n",elementType:"li",listDepth:1},{name:"pfs_dh_group",description:"<strong>(Optional)</strong> Whether the PFS of IPSec negotiation is on or off, <code>disable</code> as off, The Diffie-Hellman group as open.  Possible values: <code>disable</code>, <code>1</code>, <code>2</code>, <code>5</code>, <code>14</code>, <code>15</code>, <code>16</code>. (Default:<code>disable</code>)\n",elementType:"li",listDepth:1},{name:"sa_life_time",description:"<strong>(Optional)</strong> The Security Association lifecycle as the result of IPSec negotiation. Unit: second. Range: 1200-604800. (Default: <code>3600</code>)\n",elementType:"li",listDepth:1},{name:"sa_life_time_bytes",description:"<strong>(Optional)</strong> The Security Association lifecycle in bytes as the result of IPSec negotiation. Unit: second. Range: 1200-604800. (Default: <code>3600</code>)\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/ucloud/r/vpn_connection.html",docType:""}]}}]);